var notificationtray_pc_assistant_statement  = "<p>1. НАДАННЯ ЛІЦЕНЗІЇ<br/>Ви маєте право встановлювати та використовувати тільки одну копію ПРОГРАМНОГО ПРОДУКТУ на одній комп'ютерній системі, якщо інакше спеціально не передбачено положеннями ліцензійної згоди.<br/>Ви можете зробити одну резервну копію програмної частини ПРОДУКТУ виключно для архівних цілей.</p><p>2. ОБМЕЖЕННЯ ЛІЦЕНЗІЇ<br/>Використання ПРОГРАМНОГО ПРОДУКТУ на декількох комп'ютерах шляхом відкриття доступу до частини або всього ПРОДУКТУ.<br/>Видалення сповіщення про авторське право з будь-якої копії ПРОГРАМНОГО ПРОДУКТУ.<br/>Розкриття, передача, надання, оренда або інший спосіб, який дозволяє у будь-якій формі зробити ПРОДУКТ доступним частково або повністю третій стороні без попередньої згоди компанії HUAWEI.</p><p>3. ПРОГРАМА ЗАЛИШАЄТЬСЯ ВЛАСНІСТЮ КОМПАНІЇ HUAWEI<br />Всі права, що не надаються прямо згідно з положеннями ліцензійної згоди, зберігаються компанією HUAWEI.</p>";
